// Home.js

import React from 'react';
import './Home.css';
import heroImage from './Banners/Banner 1.jpg';

const Home = () => {
  return (
    <div>
      {/* Snap Cards Section */}
      <div className="snap-cards-section">
        <div className="scroll-snap-card red">
          <div className="slide">
            <p>Red Card</p>
          </div>
        </div>
        <div className="scroll-snap-card blue">
          <div className="slide">
            <p>Blue Card</p>
          </div>
        </div>
        <div className="scroll-snap-card green">
          <div className="slide">
            <p>Green Card</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
